function Story(props) {
  return (
    <>
      <div className="story">
            <div className="story-container">
                <div className="perfil-story">
                    <img src={props.perfil} className="foto-story" alt="perfil" />
                    <h1>{props.nome}</h1>
                </div>
            </div>
      </div>
    </>
  );
}

export default Story;
